  addpagetopdf() async {
    final response = await http.get(Uri.parse(showpdf));
    final Uint8List pdfBytes = response.bodyBytes;
    final PdfDocument pdfDocument = PdfDocument(inputBytes: pdfBytes);
    final PdfPage page = pdfDocument.pages.add();
    final String text = 'Signature Page';
    final PdfFont font =
        PdfStandardFont(PdfFontFamily.timesRoman, 16, style: PdfFontStyle.bold);
    final Size textSize = font.measureString(text);
    final double x = (page.getClientSize().width - textSize.width) / 2;

    page.graphics.drawString(
      text,
      font,
      bounds: Rect.fromLTWH(x, 0, textSize.width, textSize.height),
      format: PdfStringFormat(
        alignment: PdfTextAlignment.center,
        lineAlignment: PdfVerticalAlignment.middle,
      ),
    );
    page.graphics.drawString(
        'MS40LTAuMi0yLjMtMS4yLTIuMy0yLjVjMC0xLjQsMC45LTIuNSwyLjMtMi43YzAuNC0wLjEsMC44LTAuMSwxLjMsMGM1LjcsMC4xLDExLjMsMC4xLDE3LDAuMkM0NC4yLDY1LjEsNDcuOSw2NS4xLDUxLjcsNjUKCQlDNTEuNyw2NS4xLDUxLjcsNjUsNTEuNyw2NXoiLz4KPC9nPgo8L3N2Zz4K\n style=\"width: 24px;\"/></div></div><div style=\"width: 65px; height: 3px; border-bottom: 1px solid black; position: absolute;\"></div> <div style=\" font-family: Times, serif; font-size:12px; width: 65px; cursor: pointer; margin-left: 2px; margin-top: 8p',
        font);
    final dir = await getExternalStorageDirectory();

